#include <bits/stdc++.h>
using namespace std;

class Solution
{
public:
  long long minOperations(vector<int> &nums1, vector<int> &nums2, int k)
  {
    long long n = nums1.size(), sum1 = accumulate(nums1.begin(), nums1.end(), 0), sum2 = accumulate(nums2.begin(), nums2.end(), 0), temp = 0, inc = 0, dec = 0, res;
    if (nums1 == nums2)
      return 0;
    else if (k == 0)
      return -1;
    else if (sum1 != sum2)
      return -1;
    for (int i = 0; i < n; i++)
    {
      temp = nums1[i] - nums2[i];
      temp = temp / k;
      if (temp < 0)
        inc += abs(temp);
      else
        dec += temp;
    }
    if (inc == dec)
    {
      res = inc + dec;
      return res / 2;
    }
    return -1;
  }
};

int main()
{
  Solution st;
  vector<int> nums1 = {3, 8, 5, 2}, nums2 = {2, 4, 1, 6};
  cout << st.minOperations(nums1, nums2, 1) << endl;

  return 0;
}

